
//using Explorer.API.Controllers.Author;
using Explorer.API.Controllers.Author;
using Explorer.Blog.API.Dtos;
using Explorer.Blog.API.Public;
using Explorer.Blog.Infrastructure.Database;
using Explorer.Tours.API.Dtos;
using Explorer.Tours.Infrastructure.Database;
using FluentResults;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.DependencyInjection;
using Shouldly;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Explorer.Blog.Tests.Integration
{
    [Collection("Blog")]
    public class BlogCommandTests : IClassFixture<BlogFixture>
    {
        private BlogFixture fixture;
        public BlogCommandTests(BlogFixture fixture) 
        {
            this.fixture = fixture;
        }

        [Theory]
        [InlineData("Valid Title", "Valid description", -11, 200)]
        [InlineData(null, "Description without title", -11, 400)]
        [InlineData("Title without description", null, -11, 400)]
        public async Task CreateBlog(string title, string description, int userId, int expectedResponseCode)
        {
            // Arrange
            using var scope = fixture.Factory.Services.CreateScope();
            var controller = CreateController(scope);      

            var createBlogDto = new CreateBlogPostDto
            {
                title = title,
                description = description,
                userId = userId,
                images = new List<BlogImageDto>
                {
                    new BlogImageDto
                    {
                        base64Data = "",
                        contentType = "image/png"
                    },
                    new BlogImageDto
                    {
                        base64Data = "",
                        contentType = "image/jpeg"
                    }
                }
            };

            // Act
            var result = (ObjectResult)controller.CreateBlog(createBlogDto).Result;

            // Assert
            result.ShouldNotBeNull();
            result.StatusCode.ShouldBe(expectedResponseCode);
        }

        [Theory]
        [InlineData(-1, "Updated Title", "Updated Description", -11, 200)]   // Success
        [InlineData(-1, "", "Updated Description", -11, 400)]               // Missing title
        [InlineData(-1, "Updated Title", "", -11, 400)]                     // Missing description
        [InlineData(-1, "Updated Title", "Updated Description", 2, 400)]  // Unauthorized user
        public async Task UpdateBlogPost(long blogId, string title, string description, int userId, int expectedResponseCode)
        {
            // Arrange
            using var scope = fixture.Factory.Services.CreateScope();
            var controller = CreateController(scope);

            var updateBlogDto = new CreateBlogPostDto
            {
                title = title,
                description = description,
                userId = userId,
                images = new List<BlogImageDto>()
            };

            // Act
            var result = (ObjectResult)controller.UpdateBlogPost(blogId, updateBlogDto);

            // Assert
            result.ShouldNotBeNull();
            result.StatusCode.ShouldBe(expectedResponseCode);
        }

        [Theory]
        [InlineData(-1, -11, 200)]     // Success: Authorized user
        [InlineData(-1, 2, 400)]     // Unauthorized user
        [InlineData(999, -11, 400)]   // Blog post not found
        public async Task DeleteBlogPost(long blogId, int userId, int expectedResponseCode)
        {
            // Arrange
            using var scope = fixture.Factory.Services.CreateScope();
            var controller = CreateController(scope);

            // Act
            var result = (ObjectResult)controller.DeleteBlogPost(blogId, userId);

            // Assert
            result.ShouldNotBeNull();
            result.StatusCode.ShouldBe(expectedResponseCode);
        }

        [Theory]
        [InlineData(-1, BlogStatusDto.Published, -11, 200)]  // Success: Authorized user, valid status
        [InlineData(-1, BlogStatusDto.Closed, 2, 400)]     // Unauthorized user
        [InlineData(999, BlogStatusDto.Published, -11, 400)]// Blog not found
        [InlineData(-1, (BlogStatusDto)99, -11, 400)]        // Invalid status value
        public async Task UpdateStatus(
            long blogId,
            BlogStatusDto newStatus,
            int userId,
            int expectedResponseCode)
        {
            // Arrange
            using var scope = fixture.Factory.Services.CreateScope();
            var controller = CreateController(scope);
            var statusDto = newStatus;

            // Act
            var result = (ObjectResult)controller.UpdateStatus(blogId, statusDto, userId);

            // Assert
            result.ShouldNotBeNull();
            result.StatusCode.ShouldBe(expectedResponseCode);
        }



        private static BlogPostController CreateController(IServiceScope scope)
        {
            return new BlogPostController(scope.ServiceProvider.GetRequiredService<IBlogPostService>())
            {
                ControllerContext = BlogFixture.BuildContext("-1")
            };
        }
    }
}